import React from 'react';
import { render } from "react-dom";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Main from './component/Main';

export default function App() {
  render(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Main />}>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}
